cc.Icell_LoaderScene = cc.Class.extend({
    _logo:new Image(),
    _bg:new Image(),
    _ld:new Image(),

    /**
     * Constructor
     */
    ctor:function () {
        this._logo.src = "data:image/png;base64,";
        this._logo.width = 395;
        this._logo.height = 211;

        this._bg.src = "data:image/png;base64,";
        this._bg.width = 389;
        this._bg.height = 52;

        this._ld.src = "data:image/png;base64,";
        this._ld.width = 389;
        this._ld.height = 52;
    },

    /**
     * Draw loading screen
     */
    draw:function () {

    	ICellGame.instance.resize();

    	cc.renderContext.clearRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);
        cc.renderContext.fillStyle = "#202020";
        cc.renderContext.fillRect(0, -cc.canvas.height, cc.canvas.width, cc.canvas.height);

        var logoX = (cc.canvas.width/2 - this._logo.width/2);
        var logoY = (cc.canvas.height/2 - this._logo.height/2) + 150;
        cc.drawingUtil.drawImage(this._logo, cc.p(logoX,logoY));

        var bgX = (cc.canvas.width/2 - this._bg.width/2);
        var bgY = (cc.canvas.height/2 - this._bg.height/2) ;
		cc.drawingUtil.drawImage(this._bg, cc.p(bgX,bgY));

        var ldX = (cc.canvas.width/2 - this._ld.width/2 );
        var ldY = (cc.canvas.height/2 - this._ld.height/2 ) ;

        cc.drawingUtil.drawImage(
        	this._ld
        	, cc.p(0,0)
        	, new cc.Size(389*cc.Loader.getInstance().getProgressBar()/100,52)
        	, cc.p(ldX,ldY)
        	, new cc.Size(389*cc.Loader.getInstance().getProgressBar()/100,52)
        );
    }
});

cc.Icell_LoaderScene.getInstance = function () {
    if (!this._instance) {
        this._instance = new cc.Icell_LoaderScene();
    }
    return this._instance;
};

cc.Icell_LoaderScene._instance = null;

